import Link from 'next/link'

const linkStyle = {
    marginRight: 15
}

export default function Header() {
    return (
        <div>
            <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>About</a>
            </Link>
            <style jsx>{`
                    a{
                    color: white;
                    padding: 10px 20px;
                    display: inline-blocks;
                    background: black;
                    }
            `}
            </style>
        </div>
    )
}
